function getHandXray(tissues, thickness, spectrum) {
    // Determine the xray image produced by the given spectrum.
    var nrows = tissues.length;
    var ncols = tissues[0].length;
    var transmittedE = new Array(nrows);
    for (var i = 0; i < nrows; i++) {
        transmittedE[i] = new Array(ncols);
        for (var j = 0; j < ncols; j++) {
            switch(tissues[i][j]) {
                case 0:
                  coeffs = emptyCoeffs;
                  break;
                case 1:
                  coeffs = softCoeffs;
                  break;
                case 2:
                  coeffs = fractureCoeffs;
                  break;
                case 3:
                  coeffs = boneCoeffs;
                  break;
                default:
                  coeffs = emptyCoeffs;
                  break;
            }
            transmittedE[i][j] = beerLambertEnergy(spectrum, thickness[i][j], coeffs);
        }
    }

    return transmittedE;
}
